const platform = new H.service.Platform({
    'app_id': 'J8OBZzqaeTnw6uDVXQ4z',
    'app_code': '912OsL1so_K6IYE49DHwyw'
});

// Obtain the default map types from the platform object:
var defaultLayers = platform.createDefaultLayers();

// Instantiate (and display) a map object:
var map = new H.Map(
    document.getElementById('mapContainer'),
    defaultLayers.normal.map,
    {
        zoom: 15,
        center: { lat: -45.87416727, lng: 170.50362164 }
    });
// Setting up the default behaviours
var behavior = new H.mapevents.Behavior(new H.mapevents.MapEvents(map));

// Setting up the UI
var ui = H.ui.UI.createDefault(map, defaultLayers);

// Creating the polygons
let stripDunedin15 = new H.geo.Strip(dunedin15);
let polyDunedin15 = new H.map.Polygon(stripDunedin15, {
    style: {
        fillColor: 'rgba(183,28,28,0.18)',
        strokeColor: 'rgb(183,28,28)',
        lineWidth: 1
    }
});

